class AppNavbar extends Component
{
    state = {
        isOpen: false
    }

    toggle = () => {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }





    render()
    {
        return(
            <div>
                <link rel="shortcut icon" href="#" />
